import React from 'react';
import Paper from "@material-ui/core/Paper";




function Question({getquestionid,id, questions, index, upVote}) {

    console.log(questions);
    const q = getquestionid(parseInt(id));
    const up = upVote(id);
    console.log(q);


    return(
        <Paper>
            <h1>Title: {q.title}</h1>
            <p>Question: {q.subtitle}</p>
            <p>Category: {q.category}</p>
            <p>Upvote: {q.upVote}</p>
            <button onClick={up}>UpVote</button>
        </Paper>
    )
}

export default Question;
